// Home.js
import axios from 'axios';
import React, { Component } from 'react';
import { connect } from 'react-redux';
import logo from '../images/pos.png';
//import { Helmet } from "react-helmet"
//import propduct



class Home extends Component {

    constructor() {
        super();
        console.log('hi');
        this.state={name:''}

        //this.props.name='yasod'
        //console.log(this.props.auth);

    }

    componentDidMount() {
        if(!this.props.auth.isAuthenticated) {
            this.props.history.push('/login');
        }
    }



    render() {

        axios.post('/search',{})
            .then(res => {
                this.state=res.data;
                console.log(this.props);
            })
            .catch(err => {
                console.log('error occured!'); 
            });
        //console.log(this.props.name);
        return (

            <div>
                  <div className='container'style={{marginTop:'10px'}}>
                <div className="row" >
                    <div className="logo">
                        <img src={logo} alt='Logo' left = "400" width="100" height="100" />
                    </div>
                </div>
                </div>

                <div className="card" style={{ height: '70px', marginLeft: '0px' ,marginTop: '30px'}}>
                    <div className="card-body">
                       <h3>Open Orders.</h3> 
                    </div>
                </div>

                <div className="card" style={{ width: '300px', marginLeft: '20px' ,marginTop: '40px'}}>
                    <img src="..." className="card-img-top" alt="..."/>
                    <div className="card-body">
                        <h5 className="card-title">{this.props.name}</h5> 
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                        <a href="/" className="btn btn-primary">Go somewhere</a>
                    </div>
                </div>


            </div>





        );
    }
}


const mapStateToProps = (state) => ({
    auth: state.auth
})

export default connect(mapStateToProps)(Home);
